import React, {Component} from 'react';
import './SearchResults.css';
import { Button, Modal, ModalHeader, ModalBody, ModalFooter, FormGroup, Label, Input, Form, Card, CardTitle, CardText, CardBody} from 'reactstrap';


class SearchResults extends Component {
    constructor() {
        super();

        this.state = {
            searchResultsId : ''
        }


    }



    render() {

        const searchResults = this.props.searchResults.map((searchResult, i) =>{
            return (
                <div key={i}>
                    <div>
                        <Card>
                            <CardBody>
                                <CardSubtitle>{searchResult.displayName}</CardSubtitle>
                                <Button><a href={searchResult.uri}>Click Here to Learn More</a></Button>
                            </CardBody>
                        </Card> 
                    </div>
                </div>

            )
        })


        return (  

            <div >
                <h1>City Search Results</h1>

                <p className="searchResults"><a href=""></a>{searchResults} </p>
            </div>
        )
    }
}

export default SearchResults;
